import React from 'react';
import './Header.css';
import profile from './Images/profilePic.png';


function Heading() {
  return (
    <div className="Header-Div">
      <div className="Row">
        <div className="Header-Middle">
          <img 
            class="profileImg"
            src={profile}
            alt=""
          />
        </div>
        <div className="Header-Middle">
          <p>GameSearch</p>
        </div>
        <div className="Header-Middle">
          
        </div>
      </div>
    </div>
  );
}

export default Heading;
